import React from 'react';
import { Card, CardImg, Container, Button, CardTitle, CardText, Row, Col } from 'reactstrap';

import "../App.css"

const box = {
  marginTop: "50px",
  position: "relative",
  backgroundColor: "#ffo",
}


const ContentBox = (props) => {
  return (
  <Container>
    <Row>
      <Col sm="4">
        <div style={box}>
        <CardImg top width="100%" src="https://placeholdit.imgix.net/~text?txtsize=33&txt=318%C3%97180&w=318&h=180" alt="Card image cap" />

        </div>
      </Col>
      <Col sm="4">
        <div style={box}>
        <CardImg top width="100%" src="https://placeholdit.imgix.net/~text?txtsize=33&txt=318%C3%97180&w=318&h=180" alt="Card image cap" />

        </div>
      </Col>

      <Col sm="4">
        <div style={box}>
        <CardImg top width="100%" src="https://placeholdit.imgix.net/~text?txtsize=33&txt=318%C3%97180&w=318&h=180" alt="Card image cap" />

        </div>
      </Col>
    </Row>
  </Container>
  );
};

export default ContentBox;
